op:var(--wp--preset--spacing--40);padding-right:var(--wp--preset--spacing--50);padding-bottom:var(--wp--preset--spacing--40);padding-left:var(--wp--preset--spacing--50)\"><!-- wp:spacer {\"height\":\"var:preset|spacing|10\"} -->\n<div style=\"height:var(--wp--preset--spacing--10)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"x-large\"} -->\n<h2 class=\"wp-block-heading has-text-align-center has-x-large-font-size\">Join 900+ subscribers</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Stay in the loop with everything you need to know.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">Sign up</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->\n\n<!-- wp:spacer {\"height\":\"var:preset|spacing|10\"} -->\n<div style=\"height:var(--wp--preset--spacing--10)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></main>\n<!-- /wp:group -->','Blog Home','Displays the latest posts as either the site homepage or as the \"Posts page\" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.','publish','closed','closed','','home','','','2023-11-09 19:38:12','2023-11-09 19:38:12','',0,'http://localhost:10018/home/',0,'wp_template','',0);
INSERT INTO `wp_posts` VALUES (8,1,'2023-11-09 19:38:24','2023-11-09 19:38:24','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost:10018/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2023-11-09 19:38:24','2023-11-09 19:38:24','',2,'http://localhost:10018/?p=8',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (9,1,'2023-11-09 19:39:39','2023-11-09 19:39:39','[text* slavljenik autocomplete:slavljenik placeholder \"slavljenik/ca\"]\r\n\r\n[text* za-koga autocomplete:za-koga placeholder \"za koga\"]\r\n\r\n[text* datum-vreme autocomplete:datum-vreme placeholder \"datum/vreme\"]\r\n\r\n[text* gde autocomplete:gde placeholder \"gde\"]\r\n\r\n[submit \"Potvrdi\"]\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <miljankinez@gmail.com>\n<miljankinez@gmail.com>\nFrom: [your-name] [your-email]\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[slavljenik][za-koga][datum-vreme][gde]\r\n\r\n-------------------------------------------\n\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <miljankinez@gmail.com>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis email is a receipt for your contact form submission on our website ([_site_title] [_site_url]) in which your email address was used. If that was not you, please ignore this message.\nReply-To: [_site_admin_email]','Pozivnica1','','publish','closed','closed','','contact-form-1','','','2023-11-09 22:34:18','2023-11-09 22:34:18','',0,'http://localhost:10018/?post_type=wpcf7_contact_form&#038;p=9',0,'wpcf7_contact_form','',0);
