INSERT INTO `wp_posts` VALUES (11,1,'2023-11-09 19:41:30','2023-11-09 19:41:30','<img width=\"1920\" height=\"1080\" src=\"http://localhost:10018/wp-content/uploads/2023/11/2e4874d7609309f4dd58042b1631e429.jpeg\" alt=\"\" srcset=\"http://localhost:10018/wp-content/uploads/2023/11/2e4874d7609309f4dd58042b1631e429.jpeg 1920w, http://localhost:10018/wp-content/uploads/2023/11/2e4874d7609309f4dd58042b1631e429-300x169.jpeg 300w, http://localhost:10018/wp-content/uploads/2023/11/2e4874d7609309f4dd58042b1631e429-1024x576.jpeg 1024w, http://localhost:10018/wp-content/uploads/2023/11/2e4874d7609309f4dd58042b1631e429-768x432.jpeg 768w, http://localhost:10018/wp-content/uploads/2023/11/2e4874d7609309f4dd58042b1631e429-1536x864.jpeg 1536w\" sizes=\"(max-width: 1920px) 100vw, 1920px\" />															\n															<img width=\"36\" height=\"86\" src=\"http://localhost:10018/wp-content/uploads/2023/11/Group-1.png\" alt=\"\" />															\n			<h2>Pozivnice za roendane,<br> venanje, krtenje</h2>		\n															<img width=\"636\" height=\"86\" src=\"http://localhost:10018/wp-content/uploads/2023/11/XMLID_1_test.png\" alt=\"\" srcset=\"http://localhost:10018/wp-content/uploads/2023/11/XMLID_1_test.png 636w, http://localhost:10018/wp-content/uploads/2023/11/XMLID_1_test-300x41.png 300w\" sizes=\"(max-width: 636px) 100vw, 636px\" />															\n		<p>Elektronske pozivnice za roendane, krtenje i venanje, predstavljaju online pozivnice u obliku slike koju moete popuniti podacima, dodavanjem fotografije, koju moete poslati putem Viber-a, WhatsApp-a i Email-a.</p><p>Hvala Vam to ste odabrali #IzradiOnlinePozivnicu i pridruili nam se u stvaranju nezaboravnih uspomena.</p>		\n															<img width=\"406\" height=\"373\" src=\"http://localhost:10018/wp-content/uploads/2023/11/Group.png\" alt=\"\" srcset=\"http://localhost:10018/wp-content/uploads/2023/11/Group.png 406w, http://localhost:10018/wp-content/uploads/2023/11/Group-300x276.png 300w\" sizes=\"(max-width: 406px) 100vw, 406px\" />															\n			<h3>Molimo vas</h3>		\n			<h2>POPUNITE POLJA</h2>		\n															<img width=\"636\" height=\"86\" src=\"http://localhost:10018/wp-content/uploads/2023/11/XMLID_1_test.png\" alt=\"\" srcset=\"http://localhost:10018/wp-content/uploads/2023/11/XMLID_1_test.png 636w, http://localhost:10018/wp-content/uploads/2023/11/XMLID_1_test-300x41.png 300w\" sizes=\"(max-width: 636px) 100vw, 636px\" />															\n															<img width=\"395\" height=\"470\" src=\"http://localhost:10018/wp-content/uploads/2023/11/Group-3-e1699561834923.png\" alt=\"\" srcset=\"http://localhost:10018/wp-content/uploads/2023/11/Group-3-e1699561834923.png 395w, http://localhost:10018/wp-content/uploads/2023/11/Group-3-e1699561834923-252x300.png 252w\" sizes=\"(max-width: 395px) 100vw, 395px\" />															\n															<img width=\"423\" height=\"409\" src=\"http://localhost:10018/wp-content/uploads/2023/11/Group-2.png\" alt=\"\" srcset=\"http://localhost:10018/wp-content/uploads/2023/11/Group-2.png 423w, http://localhost:10018/wp-content/uploads/2023/11/Group-2-300x290.png 300w\" sizes=\"(max-width: 423px) 100vw, 423px\" />															\n															<img width=\"1748\" height=\"1240\" src=\"http://localhost:10018/wp-content/uploads/2023/11/998166ac349101d96288a80b3d409e2e.jpeg\" alt=\"\" srcset=\"http://localhost:10018/wp-content/uploads/2023/11/998166ac349101d96288a80b3d409e2e.jpeg 1748w, http://localhost:10018/wp-content/uploads/2023/11/998166ac349101d96288a80b3d409e2e-300x213.jpeg 300w, http://localhost:10018/wp-content/uploads/2023/11/998166ac349101d96288a80b3d409e2e-1024x726.jpeg 1024w, http://localhost:10018/wp-content/uploads/2023/11/998166ac349101d96288a80b3d409e2e-768x545.jpeg 768w, http://localhost:10018/wp-content/uploads/2023/11/998166ac349101d96288a80b3d409e2e-1536x1090.jpeg 1536w\" sizes=\"(max-width: 1748px) 100vw, 1748px\" />															\n		[contact-form-7 id=\"31f4ff9\" title=\"Pozivnica1\"]','Poetna','','publish','closed','cl